import { useRef, useState } from 'react'
import { images } from '../constants'

function LoginAccount() {
  const width = useRef(window.innerWidth).current
  const height = useRef(window.innerHeight).current
  return (
    <div>
      <div
        style={{
          display: 'flex',
          height: height * 0.08,
          flexDirection: 'row',
        }}
      >
        <div
          style={{
            height: height * 0.08,
            width: width * 0.1,
            backgroundColor: 'red',
            display: 'flex',
            flexDirection: 'row',
          }}
        >
          <img
            src={images.thu}
            style={{
              height: 28,
              marginTop: 16,
              marginLeft: 13,
            }}
          />
        </div>
      </div>
    </div>
  )
}

export default LoginAccount
